import { useState  } from "react"
import { getCookie, removeCookie } from "../Cookie/Cookie"

const Header = () => {

    const [id , setId] = useState('')

    useEffect(() => {

        setId(getCookie("key"))
        

    } , [])


    const logOut = () => {
        removeCookie("key");
        removeCookie("refreshToken");
        removeCookie("accessToken");
    }

    return(
        <div>
            <h1>{id}</h1>
            <button>로그아웃</button>
        </div>
    )
}

export default Header;
